import React, { Component } from "react";
import "../styles/Navbar.scss";
import "../images/pulse.gif";

class Navbar extends Component {
    render() {
        return(
            <div class="container">
                <div class="logo">
                    <img src="../images/pulse.gif" alt="Logo" width="100" />
                </div>
                <nav>
                    <ul>
                        <li>Home</li>
                        <li>Services</li>
                        <li>Products</li>
                        <li>Clients</li>
                    </ul>
                </nav>
            </div>
        )    
    }
}

export default Navbar;
